import './loginpage.css';

const LoginPage = () => {
    function handleEmailSpanClick() {
        // Get the span element
        const emailSpan = document.querySelector('#email-span');

        // Create a new input element
        const emailInput = document.createElement('input');

        // Set the type and name attributes of the input element
        emailInput.type = 'email';
        emailInput.name = 'email';

        // Replace the span element with the input element
        emailSpan.parentNode.replaceChild(emailInput, emailSpan);

        // Focus on the input element
        emailInput.focus();
      }

  return (
    <div className="login">

        <div className="left-container">
            <h1 className='logintext1'>Login to Your Account</h1>
            <div className='email'>

         {/*<input type="email" id="email" name="email"/>*/}
        </div>

        </div>
        <div className="right-container">
            <h1 className="newhere">New Here?</h1>
            <p className="newheretext">Join now to discover exclusive medications and book quick appointments with your preferred doctors! </p>
            <div className="signup" >
            <span>Sign Up</span>
            </div>
        </div>

      </div>

  );
}

export default LoginPage;
